            footer_faq_what_is_line: "Bahis platformu nedir?",
            footer_faq_what_is_line_text1: "Başarılı bir bahisçi olmanın anahtarı, farklı bahisçiler tarafından sunulan oranları analiz etmektir. Birçok kişi \"bahis oranları analizi\" sayesinde kendi stratejisini inşa eder. Analiz yaparak uzun vadede %75-80 oranında geri dönüş alabilirsiniz.",
