            footer_faq_where_get_data_for_line_analysis: "Bahis analizleri için nereden bilgi alabilirim?",
            footer_faq_where_get_data_for_line_analysis_text1: "{name}; futbol, tenis, buz hokeyi ve diğer bir çok spor müsabakasında olasılıkları gerçek zamanlı olarak etkili bir şekilde analiz etmeniz için ihtiyacınız olan en güncel ve güvenilir bilgileri sizlere sunar.",
            footer_faq_where_get_data_for_line_analysis_text2: "{name}'in en önemli özelliği, profesyonel analistleri sayesinde firmalar tarafından sunulan tüm oranları takip ederek sizlere en iyi oranları sunmaktır. {name}ile haftanın 7 günü 24 saat istediğiniz zaman bahis yapabilirsiniz!",
            footer_faq_are_there_bets_witch_high_odds_in_the_line: "Bahis şirketi yüksek oranlı bahisler sunuyor mu?",
            footer_faq_are_there_bets_witch_high_odds_in_the_line_text1: "Bugün dünyanın en pahalı spor türü olarak bilinen futbol üzerine bahis yapmak çok popüler. Futbol için her zaman en iyi oranları sunar ve her türlü bahis imkanı sitemizde mevcuttur.",
            footer_faq_are_there_bets_witch_high_odds_in_the_line_text2: "Tekliflerimize baktıktan sonra, Oranların gerçekten sizlere hitap ettiğini göreceksiniz. Sonuç, doğru skor tahmini, devre arası - maç sonu bahisleri, kırmızı kart sayısı, gol atacak oyuncular gibi seçenekler ve daha fazlasına bahis yapabilirsiniz.",
            footer_faq_are_there_bets_witch_high_odds_in_the_line_text3: "{name} favori sporlarınız için sizlere en iyi oranları sunar. Bilginizi ve hislerinizi kullanarak size en uygun bahsi seçip kâr etmek için bahsinizi hemen yapın!",
            footer_faq_are_there_bets_witch_high_odds_in_the_line_text4: "Gerçek tenis severler için bahis şirketi en iyi bahis imkanlarını sunmaktadır. Sadece maç sonucuna değil; handikap, toplam sayı ve toplam set sayısınada bahis yapabilirsiniz. Bizimle oyunun galibine ayrı bahis yapılabileceği gibi, handikap, her ayrı set için toplam sayı, setlerdeki mola sayısı ve daha birçok alanda bahis yapalabilirsiniz.",
            footer_faq_can_novice_play_on_the_line: "Deneyimli bir bahişçi değilim, Bahis Şirketiniz aracılığıyla bahis yapabilir miyim?",
