            footer_faq_can_novice_play_on_the_line_text2: "Bugün için sunduğumuz bahisleri ve oranları dikkatlice inceleyerek dilediğiniz maçı seçip bahsinizi gerçekleştirin ve müsabakaları zevkle izlerken para kazanmaya başlayın!",
            footer_faq_line_bets_for_professional: "Bahis şirketi profesyonel bahişçilere neler sunuyor?",
